Sign up for the <a target="_blank" data-iref="fp-content-wide-body" href="https://www.dealnews.com/lw/click.html?20,2,2167586">Chase Sapphire Preferred® Credit Card</a> and earn <strong>50,000 bonus points</strong> after you spend <a target="_blank" data-iref="fp-content-wide-body" href="https://www.dealnews.com/lw/click.html?20,2,17086874,2167586">$4,000 or more</a> on purchases in the first three months from account opening – that's $625 toward travel when you redeem through Chase Ultimate Rewards®. Plus, earn <strong>5,000 bonus points</strong> after you add the first authorized user and make a purchase in the first three months from account opening. Also, earn <strong>2 points</strong> for every $1 spent on travel and dining at restaurants both in the U.S. and abroad, and <strong>1 point</strong> for every $1 spent on all other purchases. There's a <strong>$0 Intro Annual Fee</strong> for the first year, then $95 for each additional year, and <strong>no foreign transaction fees</strong> on purchases made outside the United States. For more terms and conditions, <a target="_blank" data-iref="fp-content-wide-body" href="https://www.dealnews.com/lw/click.html?20,2,17086877,2167586">click here</a>.<br>
